// import logo from './logo.svg';
// import './App.css';
// import './Components/Portfolio'
import React from 'react';

class Portfolio extends React.Component{
  render (){
    return (
      <>
        <div className="width">
            <h5>Hi, My name is</h5>
            <h1>Sofen Chowdhury.</h1>
            <h3>I build products that people will use</h3>
            <p>
              I'm a growing Software Engineer, who specializes in building Android applications for best digital experiences.<br/>Currently I'm an SWE Intern at <a href="https://github.com/">GitHub</a> focused on building impactful products which can create values in people lives. </p>
        </div>
      </>
    );
  }
}

export default Portfolio;
